def add(n,x,y,grid):
	g=[]
	for i in range(9):
		g+=[[]]
		for j in range(9):
			g[i]+=[[]]
			for k in grid[i][j]:
				g[i][j]+=[k]
	g[x][y]=[n]

	for i in range(9):
		if n in g[x][i] and i!=y:
			g[x][i].remove(n)
		if n in g[i][y] and i!=x:
			g[i][y].remove(n)

	for i in range(3):
		for j in range(3):
			xx=x-x%3+i
			yy=y-y%3+j
			if n in g[xx][yy] and (xx!=x or yy!=y):
				g[xx][yy].remove(n)

	return g

def simplify(grid):
	g=[]
	for i in range(9):
		g+=[[]]
		for j in range(9):
			g[i]+=[[]]
			for k in grid[i][j]:
				g[i][j]+=[k]
	for x in range(9):
		for y in range(9):
			if len(g[x][y])==1:
				n=g[x][y][0]
				for i in range(9):
					if n in g[x][i] and i!=y:
						g[x][i].remove(n)
					if n in g[i][y] and i!=x:
						g[i][y].remove(n)

				for i in range(3):
					for j in range(3):
						xx=x-x%3+i
						yy=y-y%3+j
						if n in g[xx][yy] and (xx!=x or yy!=y):
							g[xx][yy].remove(n)

	return g

